-- "growth_rank" 테이블이 이미 존재하면 삭제
DROP TABLE IF EXISTS growth_rank;

-- "growth_rank" 테이블 생성
CREATE TABLE growth_rank (
    cor_code BIGINT(20),
    industry_id INT(11),
    cor_name TEXT,
    cor_type TEXT,
    ebitda_growth TEXT,
    sales_growth TEXT,
    eps_growth TEXT,
    selling_administrative_expenses_growth TEXT,
    operating_profit_growth TEXT,
    interest_income_growth DOUBLE,
    loan_receivables_growth TEXT,
    accrued_liabilities_growth TEXT,
    total_asset_growth DOUBLE,
    net_profit_growth TEXT,
    net_operating_income_growth TEXT,
    insurance_premium_income_growth DOUBLE,
    selling_expenses_growth TEXT,
    ebit_growth TEXT,
    operating_income_growth TEXT,
    score DOUBLE,
    tier TEXT
);

